import React from 'react';
import styled from "styled-components";
import {StyledBlueTriangle} from "./components/Triangles.js";
import blueTriangle from "./misc/images/tr_2.png";

const TriangleWrapper = styled.div`
height: 100vh;
width: 100vw;
`;


function App() {
  return (
      <TriangleWrapper>
        <StyledBlueTriangle as="img" src={blueTriangle}/>
      </TriangleWrapper>

    );
}

export default App;
